import { css } from '@emotion/css';

export const styBtnNavigation = css`
  text-decoration: none;
`;

export const styContainerBtn = css`
  width: 50px;
  height: 50px;
  background-color: blue;
  display: flex;
  justify-content: center;
  align-items: center;
  border-radius: 5px;
  cursor: pointer;
`;

export const styGoBack = css`
  cursor: pointer;
  font-weight: 600;
  :hover {
    color: blue;
  }
`;

export const styBtnEdit = css`
  cursor: pointer;
  font-weight: 600;
